import ReactSwipe from "react-swipe";
import { FaLongArrowAltRight, FaLongArrowAltLeft } from "react-icons/fa";

const PhotoSlider = () => {
  let reactSwipeEl;

  return (
    <div className='relative'>
      <ReactSwipe
        className='carousel'
        swipeOptions={{
          continuous: true,
          auto: 3000,
          speed: 500,
        }}
        ref={(el) => (reactSwipeEl = el)}
      >
        <div>
          <img
            className='main-img rounded-lg shadow-2xl '
            src='/images/o4.png'
          ></img>
        </div>
        <div>
          <img
            className='main-img rounded-lg shadow-2xl '
            src='/images/04.png'
          ></img>
        </div>
        <div>
          <img
            className='main-img rounded-lg shadow-2xl '
            src='/images/04.png'
          ></img>
        </div>
      </ReactSwipe>
      <button className='btn-nav next' onClick={() => reactSwipeEl.next()}>
        <FaLongArrowAltRight />
      </button>
      <button className='btn-nav prev' onClick={() => reactSwipeEl.prev()}>
        <FaLongArrowAltLeft />
      </button>
    </div>
  );
};

export default PhotoSlider;
